import React from "react";

const styles = {
  left: {
    display: "flex",
    backgroundColor: "blue",
    height: "100vh",
    width: "50%",
  },
  container: {
    marginLeft: "30px",
    marginTop: "30px",
    fontWeight: "bold",
  },
  a: {
    display: "block",
    marginBottom: "10px",
  },
};

function Header() {
  return (
    <div style={styles.left}>
      <div style={styles.container}>
        <a style={styles.a}>ALEX SCHER</a>
        <a style={styles.a}>ABOUT</a>
        <a style={styles.a}>GITHUB</a>
        <a style={styles.a}>LEFT</a>
      </div>
    </div>
  );
}

export default Header;
